export class NavSetRoot {
    push() {
        const nav = this.el.closest('ion-nav');
        if (nav) {
            const toPush = this.url || this.component;
            return nav.setRoot(toPush, this.componentProps);
        }
        return Promise.resolve(null);
    }
    static get is() { return "ion-nav-set-root"; }
    static get properties() { return { "component": { "type": "Any", "attr": "component" }, "componentProps": { "type": "Any", "attr": "component-props" }, "el": { "elementRef": true }, "url": { "type": String, "attr": "url" } }; }
}
